My Sisters Hot Friend - Rachael Madori
Added: November 10, 2014

Rachael Madori is hanging out at her friend's place when her friend's brother, Pete, finally notices her. It took him a minute to recognize her as she has changed a lot since the last time he's seen her. She definitely got a lot hotter. Along with that hotness Rachael picked up more confidence. Enough confidence to finally do what she's been wanting to for years: fuck Pete
